import { useNavigate } from "react-router-dom";

export default function MyAccount({ setIsLoggedIn }) {
    const navigate = useNavigate();

    const handleLogout = () => {
      setIsLoggedIn(false);
      navigate("/");
    };

    return (
      <div>
        <p>This is your account page.</p>
        <button onClick={handleLogout}>Logout</button>
      </div>
    );
  }
